import logo from "../assets/logoJC.jpg";
import github from "../assets/githubIcone.png";
import linkedin from "../assets/linkedinIcone.png";
import codewars from "../assets/codewarsIcone.png";
import "../styles/Banner.css";
import jsonData from '../data/data.json';

function Banner() {
  const title = "La maison jungle";
  return (
    <div className="cv-banner">
      <img src={logo} alt="La maisonjungle" className="cv-logoBanner" />
      <nav>
        <ul className="nav-links">
          <li>
            <a href="#languages">Langages</a>
          </li>
          <li>
            <a href="#portfolio">Portfolio</a>
          </li>
          <li>
            <a href="#diplomas">Formations</a>
          </li>
          <li>
            <a href="#jobs">Emploi</a>
          </li>
          <li>
            <a href="#contacts">Contacts</a>
          </li>
        </ul>
      </nav>
      <div className="social-banner">
        <a href={jsonData.informations.github} target=""><img src={github} className="logo"></img></a>
        <a href={jsonData.informations.linkedin}><img src={linkedin} className="logo"></img></a>
        <a href={jsonData.informations.codewars}><img src={codewars} className="logo"></img></a>
      </div>
    </div>
  );
}

export default Banner;
